*
  * Refresh your just obtained ep token
  * Tokens are 6 hrs valid, however there's no point in just calling this function without queues or sth else
  * @example
  * import tpapi from '@alexvv13/tpapi';
  *
  * const park = new tpapi.park.Rulantica();
  *
  * park.refreshEP().then((token) => {
  * console.log(token)
  * });
  * @return {string} EuropaPark JWT Token

leadingComments.value:
*
  * Refresh your just obtained ep token
  * Tokens are 6 hrs valid, however there's no point in just calling this function without queues or sth else
  * @example
  * import tpapi from '@alexvv13/tpapi';
  *
  * const park = new tpapi.park.Rulantica();
  *
  * park.refreshEP().then((token) => {
  * console.log(token)
  * });
  * @return {string} EuropaPark JWT Token

*
  * Get All POIS of EuropaPark
  * This data contains all the POIS in EuropaPark
  * @example
  * import tpapi from '@alexvv13/tpapi';
  *
  * const park = new tpapi.park.Rulantica();
  *
  * park.getPois().then((pois) => {
  * console.log(pois)
  * });
  * @return {string} EP POIS without queues

*
  * Build Rulantica ride object
  * This data contains general ride names, descriptions etc.
  * @example
  * import tpapi from '@alexvv13/tpapi';
  *
  * const park = new tpapi.park.Rulantica();
  *
  * park.buildRidePOI().then((pois) => {
  * console.log(pois)
  * });
  * @return {string} All Rulantica ride POIS without queuetimes

*
  * Build Rulantica restaurant object
  * This data contains general restaurant names, descriptions etc.
  * @example
  * import tpapi from '@alexvv13/tpapi';
  *
  * const park = new tpapi.park.Rulantica();
  *
  * park.buildRidePOI().then((pois) => {
  * console.log(pois)
  * });
  * @return {string} All Rulantica restaurant POIS

*
  * Build Rulantica Merchandise object
  * This data contains general merchandise names, descriptions etc.
  * @example
  * import tpapi from '@alexvv13/tpapi';
  *
  * const park = new tpapi.park.Rulantica();
  *
  * park.buildMerchandisePOI().then((pois) => {
  * console.log(pois)
  * });
  * @return {string} All Rulantica Merchandise POIS

*
  * Get All Queues of Rulantica
  * This data contains all the Queues in Rulantica, attached with pois above.
  * @example
  * import tpapi from '@alexvv13/tpapi';
  *
  * const park = new tpapi.park.Rulantica();
  *
  * park.getQueue().then((queue) => {
  * console.log(queue)
  * });
  * @return {string} Rulantica POIS with queues

*
  * Build Rulantica Service object
  * This data contains general service names, descriptions etc.
  * @example
  * import tpapi from '@alexvv13/tpapi';
  *
  * const park = new tpapi.park.Rulantica();
  *
  * park.buildServicePOI().then((pois) => {
  * console.log(pois)
  * });
  * @return {string} All Rulantica Services POIS

*
  * Get All Operating Hours of Rulantica
  * This data contains all the Operating Hours in Rulantica, fetched with currentyear.
  * @example
  * import tpapi from '@alexvv13/tpapi';
  *
  * const park = new tpapi.park.Rulantica();
  *
  * park.getOpHours().then((hours) => {
  * console.log(hours)
  * });
  * @return {string} Rulantica park hours

